import Avator from "../components/Avator";
import Divider from "../components/Divider";
import Page from "../components/Page";
import { Body1 } from "../components/Texts";
import { makeStyles } from "@material-ui/core/styles";


const useStyles = makeStyles({
  container: {
    background: "white",
    display: "flex",
    padding: "8px",
    borderRadius: "4px"
  },
  avatorCard:{
    padding:"24px",
    borderRadius: "4px",
    "&:hover":{
      boxShadow: "0px 0px 10px 2px rgba(0, 0, 0, 0.29)",
    }
  }
});

const Index = props => {

  const classes = useStyles(props);
  return (
    <Page>
      <p>In this page, we put 1. sercah bar / secondary bar..</p>


      {/* webList-Tab */}
      <div className={classes.container}>

        <div className={classes.avatorCard}>
          <Avator />
          <Divider vertical space="8px"/>
          <Body1>Instagram</Body1>
        </div>

        <Divider space="24px" />
        <div className={classes.avatorCard}>
          <Avator />
          <Divider vertical space="8px"/>
          <Body1>Instagram</Body1>
        </div>

      </div>
    </Page>
  )
}

export default Index;
